import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { RouterModule, Routes } from '@angular/router';

import { NetworthComponent } from './networth.component';
import { AssetCardComponent } from './asset-card/asset-card.component';
import { LoanCardComponent } from './loan-card/loan-card.component';
import { AddAssetDialogComponent } from './add-asset-dialog/add-asset-dialog.component';
import { AddLoanDialogComponent } from './add-loan-dialog/add-loan-dialog.component';
import { LoanDetailDialogComponent } from './loan-detail-dialog/loan-detail-dialog.component';

const routes: Routes = [
  {
    path: '',
    component: NetworthComponent
  }
];

@NgModule({
  declarations: [
    NetworthComponent,
    AssetCardComponent,
    LoanCardComponent,
    AddAssetDialogComponent,
    AddLoanDialogComponent,
    LoanDetailDialogComponent
  ],
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule,
    RouterModule.forChild(routes)
  ],
  exports: [
    NetworthComponent  // Export so it can be used in InvestmentsModule
  ]
})
export class NetWorthModule { }
